This second edition is an authoritative and established aid in the diagnosis of the clinical aspects of tropical mediccine parasitology. It covers pathology, parasitology and ecology of all the diseases encountered in warmer climates, as well as the parasitic diseases of temperate regions. Extensively updated and revised new artworks have been created for the world-wide maps showing distribution of the disease, as well as life cycles, and there are nearly 200 new images. This highly illustrated atlas complements many textbooks on tropical medicine, and any serious student of Tropical Medicine will find this an invaluable source of information. FEATURES: Additional new material on AIDS and AIDS linked problems; New artworks, life cycles and temperature/ pulse graphs; Updated world-wide distribution maps of major tropical diseases; Almost 1000 full colour clinical illustrations.

